import React from 'react';
import { View, Text, StyleSheet, Image } from 'react-native';

export default function AboutUs() {
  return (
    <View style={styles.container}>
      <Image
        source={require('../assets/starbucks_logo.png')}
        style={styles.logo}
      />
      <Text style={styles.title}>Acerca de Starbucks</Text>
      <Text style={styles.description}>
        Starbucks es una cadena de cafeterías fundada en Seattle en 1971. 
        Actualmente, Starbucks es la cadena de cafeterías más grande del mundo, 
        con más de 30,000 tiendas en todo el mundo.
      </Text>
      <Text style={styles.mission}>
        Nuestra Misión: Inspirar y nutrir el espíritu humano; 
        un individuo, una taza y una comunidad a la vez.
      </Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo: {
    width: 150,
    height: 150,
    marginBottom: 20,
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  description: {
    fontSize: 16,
    textAlign: 'center',
    marginBottom: 20,
  },
  mission: {
    fontSize: 16,
    textAlign: 'center',
    color: '#555',
  },
});
